mongo forEach unable to update array in document<p>I'm trying write a mongo script to run in RoboMongo that will loop through all documents in a collection.  Each document contains an array <code>myArray</code>. The documents look like this:</p>

<pre><code>{
  "name": "myApp",
  "myArray": [
    { "env": "dev", "dbHost": "db2dev.local" },
    { "env": "prod",  "dbHost": "db1prod.local" }
  ]
</code></pre>

<p>I want to copy the dbHost field that is defined in dev to prod.  So the above result would be:</p>

<pre><code>{
  "name": "myApp",
  "myArray": [
    { "env": "dev", "dbHost": "db2dev.local" },
    { "env": "prod",  "dbHost": "db2dev.local" }
  ]
</code></pre>

<p>When I try to access the field <code>myArray[0]</code> I get a syntax error that says:</p>

<pre><code>TypeError: myDoc.myArray[0] is undefined
</code></pre>

<p>The function is something like this:</p>

<pre><code>db.myCollection.find().forEach( function(myDoc) {
    var devIdx = 0;
    var prodIdx = 1;
    if (myDoc.myArray[0].env !== 'dev')}
        devIdx = 1;
        prodIdx = 0;
    }
    myDoc.myArray[prodIdx].dbHost = myDoc.myArray[devIdx].dbHost;

    print(myDoc);
});
</code></pre>

<p>I've examined the collection (it is very small) and each document has a <code>myArray</code> field as it should with exactly two values (one for <code>dev</code> and one for <code>prod</code>) in the array.</p>

<p><strong>What am I doing wrong?  What is the correct syntax to use inside a mongo script?  Is updating arrays in a document not supported?</strong></p>

<h1>Searching for solution</h1>

<p>I've searched and found forEach examples but most are trivial and none include an array being accessed or changed.</p>

<p>The mongo docs are also very simplistic: <a href="https://docs.mongodb.com/v3.6/reference/method/cursor.forEach/" rel="nofollow noreferrer">https://docs.mongodb.com/v3.6/reference/method/cursor.forEach/</a></p>

