<p>I make an ajax get request to my node server and the server is supposed to find the documents according to the "breed" variable, put it in a list and send it back to the client. </p>

<p>Then in the success part of ajax, I'm to populate a listview with the list.</p>

<p>The problem is that the find() functions returns null I believe even though I have one document in my collection that satisfies the condition.</p>

<p>Here is how I'm retrieving the documents:</p>

<pre><code>function search(req,res){
  var merr = mongoerr400(res)

  var breed
  if  (req.params.query == "Foghorn")
  breed={breed:"Foghorn"};
  else if  (req.params.query == "Hawk")
  breed = {breed:"Hawk"};
  else if (req.params.query == "Tweety")
  breed = {breed:"Tweety"};
  else if (req.params.query == "Little")
  breed = {breed:"Little"};
