How to connect schemas with each other in mongooseJS?<p>Basically what I am trying to achieve is the following:
In my iOS application a QR-Code can be scanned to get the ID of a specific lounge and with that its JSON data (only ID and name for now) saved in MongoDB.</p>

<p>Every lounge is able (but doesn't have to) to add products to their lounge, so that in the end, after scanning the QR-Code, a customer is able to see which products are offered.</p>

<p>A product contains only a name and imageURL for now, but not a price, because the price can variate and be set by owners of a lounge. So a price of one and the same product can be different.</p>

<p>I would like to know, what the correct and best way is for implementing the schemas for that approach, so that I can easily fetch all products of a specific lounge, maybe based on its ID.</p>

<p>What I got so far:</p>

<p>lounge.js:</p>

<pre><code>const mongoose = require('mongoose');

const loungeSchema = mongoose.Schema({
    _id: mongoose.Schema.Types.ObjectId,
    name: { type: String, required: true }
});
</code></pre>

<p>module.exports = mongoose.model('Lounge', loungeSchema);</p>

<p>product.js</p>

<pre><code>const mongoose = require('mongoose');

const productSchema = mongoose.Schema({
    _id: mongoose.Schema.Types.ObjectId,
    name: { type: String, required: true },
    imageURL: { type: String, required: true, unique: true }
});

module.exports = mongoose.model('Product', productSchema);
</code></pre>

